import { Container } from "react-bootstrap";
import BaseLayout from "../BaseLayout";
import Slider from "../components/shared/HomePage/Slider";
import Banner from "../components/shared/HomePage/Banner";
import FoldersSection from "../components/shared/HomePage/FoldersSection";
import ForumSection from "../components/shared/HomePage/ForumSection";
import FormsSection from "../components/shared/HomePage/FormsSection";
import "../static/fontawesome/fontawesome";

const Home = (title) => {
  return (
    <BaseLayout title={title}>
      <Slider />
      <Banner />
      <Container className="wrapper main-content-section">
        <FoldersSection />
        <ForumSection />
      </Container>
      <FormsSection />
    </BaseLayout>
  );
};

export default Home;
